    return (
        <section className={styles.ingredients}>
          <ul classname={styles.ingredients__list}>
            <li>
                <h2>Булки</h2>
            </li>
            <li>
                <h2 className="text text_type_main-medium mt-2">Соусы</h2>{" "}
            </li>
            <li>
                <h2 className="text text_type_main-medium mt-2">Начинки</h2>
            </li>
          </ul>
        </section>
      );
}
